(14, 8, 8, 'INTRODUCTION', '1.1 DESCRIPTION The global solar control window films market was valued USD 631.20 million in 2015, which is expected to reach USD 1,122.67 million by 2020, growing at a CAGR of 12.21%. The Asia-Pacific and Middle-East and African markets are the fastest growing ones, with the European market remaining constant.  Solar control window films have been extensively used in commercial and residential buildings since the 1950s as a protective sheet installed on windows. These window films serve a wide variety of purposes like providing protection against damaging ultra violet radiations that can cause fading of fabrics, furnishings or display articles, blocking glare,reducing heat within a building, lowering energy costs by reducing air conditioning needs and providing privacy while making buildings look attractive. Solar control window films are manufactured mainly from polyethylene terephthalate (PET), a common thermoplastic resin belonging to the polyester family. They are used because of their excellent optical properties and strength. The raw material PET is in the form of pellets that are melted and stretched biaxially into polyester sheets, which are then processed according to its applications. The reduction in carbon footprint that these films bring, along with the savings incurred in energy bills make them very attractive for use in residences and commercial installations alike. It is also a low-cost, short-payback-period technology. In addition to these, the security and privacy that they provide, and the protection from UV and IR radiations serve as the main drivers for this market. Identifying an appropriate film depending on climatic conditions and glass specifications is one of the main challenges for this market. The cost curtailed thereby on making a wrong decision keeps the customer from investing in it.   1.2RESEARCH METHODOLOGY Introduction The research process adopted for this entire study is a highly structured two stage process: size estimation of the review period, and the market engineering for the forecast period of the global, country and segment-level data that lead to the Data Generation Process (DGP) for the studied variables. The size estimations were carried out through multiple bottom-up & top-down approaches. The bottom-up approach includes the examining of historical revenues of key players, studying the size of the applications, value and supply-chain analysis, end-user demand, which are then cross-validated by secondary and primary resources. The top-down approach is an astute research process where the global market sizing is carried out through the secondary research, validated by primary industry experts.  In this report, for analyzing the future trends for the studied market during the forecast period, we have incorporated rigorous statistical and econometric methods, further scrutinized by secondary, primary sources and by our in-house experts supported through our extensive data intelligence repository. The market is studied holistically from both demand and supply-side perspectives. This is carried out to analyze the end-user and producer behavior patterns in the review period that affect the price, demand and consumption trends. As the study demands analyzing the long-run nature of the market, the identification of factors influencing the market is based on the fundamentality of the market that is studied. Through secondary and primary research, the factors that are endogenous & exogenous in nature are identified, and they are transformed to quantitative data through data extraction and further applied for inferential purpose.', '5', '2022-06-03 10:27:03', '2022-06-03 10:36:38'),
